        years = map(lambda x: x.year, [base + relativedelta(years=x) for x in range(0, 15)])
        for year in years:
            # select checkboxes for every year
            pattern = re.compile(r'%s'%year)
            a = soup.find('a', text=pattern)
            prev_table = a.findParent('table')
            date_checkboxes = prev_table.findChildren('input')
            date_checkbox_ids_active = map(lambda checkbox: checkbox['name']+'=on', date_checkboxes)

            params = '&'.join([price_type_checkbox, state_checkbox_active] + food_checkbox_ids_active + date_checkbox_ids_active)
